const PagBase = styled.section`
pagBase {
  display: flex;
}

.menu-lateral {
  height: 100vh;
  width: 20vw;
}

.menu-lateral ul {
  padding: 20px;
  border-top: 1px solid black;
  list-style: none;
}

.menu-lateral h2 {
  padding-left: 20px;
  margin-bottom: 22px;
}

.gerenciador-de-tarefas {
  width: 100vw;
  border-left: 1px solid black;
}

.minhas-tarefas {
  width: 100vw;
