  transition: 0.3s;
}

.filtro-menu-lateral:hover {
  color: #000;
}

.filtro-menu-lateral.ativo {
  color: #000;
  background-color: #f0f0f0;
  border-radius: 5px;
}

ul li img {
  width: 25px;
  margin-right: 15px;
  margin-bottom: -7px;
}

h2{
  margin-left:16px ;
}

h2 img {
  width: 25px;
  margin-right: 15px;
  margin-bottom: -6px;
}
h1{
 font-size: 35px;
}
`;

function PaginaBase() {


  return (
    <PagBase>
      <section className="menu-lateral">
        <h2>menu lateral</h2>
        <ul>
          <li>Agenda</li>
          <li>Clientes</li>
          <li>Servicos</li>
        </ul>
      </section>
    </PagBase>
  );
}

export default PaginaBase;
